$(function(){$("#geocomplete").geocomplete().bind("geocode:result",function(e,t){$.log("Result: "+t.formatted_address)}).bind("geocode:error",function(e,t){$.log("ERROR: "+t)}).bind("geocode:multiple",function(e,t){$.log("Multiple: "+t.length+" results found")}),$("#find").click(function(){$("#geocomplete").trigger("geocode")}),$("#examples a").click(function(){return $("#geocomplete").val($(this).text()).trigger("geocode"),!1})});